INSERT INTO `news` VALUES (15,'Version Bêta 2.0','C\\\'est un nouveau départ pour UTR, puisque voilà la version Bêta 2.0 qui apporte un tas de changements.\r\nEnfin vous ne ferez pas les mêmes temps dans les courses ! Enfin j\\\'espère...\r\n\r\nPar contre, une réinscription générale est nécessaire !',NULL,'Ben-J','2004-09-05 23:30:51','1'),(19,'Améliorations !','Et bien voilà, le module de messagerie concocté par Chépakoi alias Aka est terminé est installé dans sa version première, n\\\'hésitez pas à en dire du mal dans le forum ;-)\r\n\r\nD\\\'autre part, des localisations ont été rajoutées ( Carrosserie, Echappement, Turbo ) et la gestion des courses a encore été améliorée.',NULL,'Le Pacha','2004-09-08 14:16:53','1'),(20,'Pas de modifs pendant 1 semaine','Au moins jusqu\\\'au 20 Septembre il n\\\'y aura pas de modifications techniques du site, car Tomy refait complètement le design. Vous pouvez toujours signaler les bugs, les changements seront effectués comme prévus, mais ils sont retardés.\r\n\r\nEn attendant, voici un petit aperçu de ce que je vous réserve pour la \\\"rentrée\\\" :\r\n- Affichage de l\\\'état général de la voiture ( Non opérationelle, HS... )\r\n- Pareil pour les pièces détachées ( Affichage en rouge si cassé )\r\n- Refonte du système de changement de pièces détachées\r\n- Système de tri pour les listes de pièces détachées.\r\n- Affichage des statistiques d\\\'UTR ( meilleurs pilotes, etc... )\r\n- Intervention du hasard dans les courses',NULL,'Le Pacha','2004-09-13 23:18:47','1'),(21,'Reprise des MAJ','Et bien c\\\'est reparti, comme prévu je me remet au charbon. Le nouveau design n\\\'est malheureusement pas prêt car Tomy a trouvé un boulot rémunéré, mais il s\\\'y remettra une fois qu\\\'il aura fini.',NULL,'Le Pacha','2004-09-20 15:36:47','1'),(22,'salut les gars','salut les gars, il parait que vous nous laissez tomber?\r\nVous ne jouez plus et ca m\\\'intrigue un peu il faut reagir je suis a votre disposition si vous avez besoin de donner vos avis je suis a l\\\'ecoute tout les jours et par mail aussi bon il faut rebondir apres cette periode de silence',NULL,'nergal','2004-10-11 12:42:16','1'),(23,'Changements effectués','- Refonte du formulaire de changement de pièce ( ça vaut le détour ;-) )\r\n- Suppression du bug de changement d\\\'identité quand on consulte la fiche d\\\'un manager\r\n\r\nEn prévision :\r\n- Refonte du formulaire d\\\'inscription à une course\r\n- Grosse modification de la base de donnée ( Bêta version 3 )',NULL,'Le Pacha','2004-10-13 21:34:09','1'),(25,'le pacha modification','le pacha voici un lien pour avoir firefox en francais c\\\'est mieux que celui en anglais.\r\nhttp://prdownloads.sourceforge.net/frenchmozilla/FirefoxSetup-0.9.3-fr-FR.exe?',NULL,'nergal','2004-10-15 12:10:53','1'),(26,'Messagerie V2','C\\\'est donc Chépakoi qui nous a pondu cette semaine la messagerie version 2.\r\n\r\nNouveautés :\r\n- Plus de fenêtres innombrables\r\n- Interface améliorée\r\n- Possibilités d\\\'envoyer un message avec un sujet ou un message vide',NULL,'Le Pacha','2004-10-24 21:50:07','1'),(27,'lu petit changement','bon a partir d\\\'aujourd\\\'hui c\\\'est moi qui prend les renes donc adressez vous a moi et ce jusqu\\\'a nouvel ordre.\r\nQuand pacha sera de retour vous le saurez',NULL,'nergal','2004-10-27 15:46:04','1'),(28,'Debug mode ON','Pour pouvoir enfin trouver d\\\'où vient le fait que les courses sont systématiquement supprimées, j\\\'ai activé le mode débug du traitement des courses.\r\n\r\nCe qui veut dire que, quand une course se fera, des tas de trucs s\\\'afficheront, et la course ne sera pas effectivement jouée. Je demande à celui qui obtient l\\\'affichage de me mailer les affichages qu\\\'il obtient. J\\\'essaierai de répondre au plus vite, car quand le mode débug est activé, on ne peut théoriquement plus se loguer.',NULL,'Le Pacha','2004-11-22 18:19:56','1'),(30,'les petits changements','Voila nous allons effectuer des changements dans le jeu et nous allons vous laisser la surprise de les decouvrir vous même.\r\n\r\nIls n\\\'affecterons en rien de grave le jeu et le systeme de jeu donc ne prennez pas peur.\r\n\r\nLa je prefere vous dire deja que celui qui envoi le bilan de la course sera maintenant le createur et non plus \\\"pacha\\\".\r\n\r\nSi jamais il y a des reclamations apres merci de me contacter et non pas celuiq ui a cree la course parce qu\\\'il ne peux pas acceder aux coulisses de la course pour tricher\r\n\r\nSinon pour ceux qui ont des suggestions je suis a l\\\'ecoute 24/24 7/7 par ma com-talker et même mon mail, j\\\'attends vos messages et même vos critques.',NULL,'nergal','2004-11-24 11:59:14','1'),(31,'une nouveaute','voila on fais des changements ben on vous apportes de nouvelles choses\r\n\r\non a ajoute les comentaires aux courses, si les createurs veulent dire quelque choses de leur courses, par exemple pourquoi ils l\\\'ont creee ils peuvent se lacher dans cette case',NULL,'nergal','2004-11-25 17:22:14','1'),(32,'Allo?','^^',NULL,'persephone','2004-12-02 08:47:17','0'),(33,'Moteur de courses réparé','Bon, après quelques jours de mécanique, le moteur des courses tourne enfin correctement.\r\nS\\\'il devait y avoir le moindre bug, ce sera sympa de m\\\'avertir, merci :-)',NULL,'Le Pacha','2004-12-08 11:56:06','1');
